(function(w){
    try{
        if(w.editorConfig){
            w.editorConfig.storageManager={
                    // Enable draggable and dragmove options
                    draggableComponents: true,
                    draggable: true,
                    autosave: false,
                    allowScripts: 1,
            }

        }
    }catch(e){}
})(window)
